NGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CNgCEM2rARgBIhMI1bGu65S8kgMV7ApoCB2pHzKDygEEHu2x_Q==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CNgCEM2rARgBIhMI1bGu65S8kgMV7ApoCB2pHzKDygEEHu2x_Q==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"This time in the #KinoCheckNews Highlander, Deadpool 4, Star Wars, Black Panther 3, \"How to Train Your Dragon 2\" etc.| App  https://KinoCheck.com/App | Best Movie News Show | All News https://KinoCheck.com/news\n\n00:00 First Images from the Highlander Reboot Starring Henry Cavill\nHenry Cavill has taken on the lead role in the reboot of the fantasy classic \"Highlander\". Now he's sharing the first images from the film with his fans.\nhttps://kinocheck.com/news/2s2qyk\n\n01:11 Rumor: Work on Deadpool 4 Has Begun!\nThe mercenary with the big mouth returns! After the huge success of \"Deadpool \u0026 Wolverine\", fans are eagerly awaiting a fourth film in the series  and now the time has come. As Puck magazine reports, Ryan Reynolds is indeed working hard on \"Deadpool 4\"!\nhttps://kinocheck.com/news/3obf4w\n\n02:03 New Trailers\n\n02:46 The Beekeeper 2: Release Date for the Jason Statham Sequel Announced\nThe Hollywood star returns in \"The Beekeeper 2\"! Following the success of the first film, the sequel to the action thriller is in the pipeline. Amazon MGM has now officially announced the release date. And with \"Shelter\", another Jason Statham action film is just around the corner\nhttps://kinocheck.com/news/xj3nbx\n\n03:38 New Update on Taika Waititi's Star Wars Movie\nThe as yet untitled film by \"Thor\" director Taika Waititi has not yet been affected by this. Kathleen Kennedy recently spoke briefly about the current status of the project in her \"exit interview\" with industry magazine Deadline. Taika Waititi himself has also revealed a few details about his film!\nhttps://kinocheck.com/news/3km831\n\n04:33 New Star Trek Movie: Chris Pine Gives Kirk Fans Little Hope\nChris Pine commented on a possible return as Enterprise captain James T. Kirk. However, his words give fans little reason for hope.\nhttps://kinocheck.com/news/nlz06j\n\n05:19 Aaron Pierre in Talks to Become the New Black Panther\nHot rumors about the casting of the new Black Panther! After \"F1\" star Damson Idris has already been linked to the role several times, another actor is now throwing his hat into the ring. As insider Daniel Richtman revealed, \"Rebel Ridge\" star Aaron Pierre is now also in talks with Marvel.\nhttps://kinocheck.com/news/uf69m9\n\n06:13 No Theatrical Release! The Gundam Film Starring Sydney Sweeney Will Be Released on Netflix\nAccording to Deadline, the \"Gundam\" live-action feature adaptation starring Sydney Sweeney won't be released in movie theaters. Instead, it will go straight to Netflix. That's not to say a theatrical release is completely off the table. After all, the streaming service has occasionally released movies in theaters for a limited time in the past. However, this has not been officially confirmed yet  so we'll just have to wait and see.\nhttps://kinocheck.com/news/sitpju/\n\n07:05 How to Train Your Dragon 2: Start of Filming and Casting Update for the Live-Action Adaptation\nFilming of the second live-action adaptation has now officially begun! This was announced by director Dean DeBlois and Universal Pictures via social media. But that's not all: there is also news regarding the cast!\nhttps://kinocheck.com/news/1x5qfb\n\n08:07 Tobey Maguire in Avengers Doomsday: Alleged Leak of the Opening Scene!\nSeveral well-known insiders have reported on the alleged opening scene, which is said to eclipse everything that superhero movies have ever shown at the beginning. Beware: There is a risk of spoilers if there is any truth to the rumors!\nhttps://kinocheck.com/news/euh4r7\n\n09:16 Dwayne Johnson to Return as the Scorpion King for The Mummy 4\nAccording to well-known insider Daniel Richtman, Universal Pictures is planning to bring Johnson back as the Scorpion King for \"The Mummy 4\". The character was introduced in 2001's \"The Mummy Returns\" and served as the central antagonist.\nhttps://kinocheck.com/news/0s660r\n\n10:34 The Brave and the Bold: Screenwriter Hired for New DCU Batman Film\nFinally, some progress on the new DCU Batman! With \"The Brave and the Bold\", we are getting a second Dark Knight alongside Robert Pattinson  and now it looks like we know who's writing the story.\nhttps://kinocheck.com/news/7dp1hp\n\n11:28 Game of Thrones Sequel Series \u0026 Possible Feature Film About Aegon's Conquest!\nNew projects from Westeros are already being worked on behind the scenes. These include a sequel series and a possible feature film about \"Aegon's Conquest\".\nhttps://kinocheck.com/news/m1tkry\n\n13:11 Here are the 2026 Oscar Nominations!\nThe 98th Academy Awards ceremony will take place on March 15, 2026. As usual, the most important film event of the year will honor the outstanding actors, directors, screenwriters and co. for their achievements. The big surprise in the run-up: a new Oscar record was set!\nhttps://kinocheck.com/news/8vmz4k\n\nNote | News with courtesy of all involved publishers. | All Rights Reserved. #KinoCheck","commandRuns":[{"startIndex":17,"length":14,"onTap":{"innertubeCommand":{"clickTrackingParams":"CNoCENzXBBg_IhMI1bGu65S8kgMV7ApoCB2pHzKDygEEHu2x_Q==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/kinochecknews","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gURCg1raW5vY2hlY2tuZXdzGAE%3D"}}},"loggingDirectives":{"trackingParams":"CNoCENzXBBg_IhMI1bGu65S8kgMV7ApoCB2pHzKD"}},{"startIndex":133,"length":25,"onTap":{"innertubeCommand":{"clickTrackingParams":"CNgCEM2rAR ,"raisedBackground":4294963440,"additiveBackground":567754551,"textPrimary":4282124036,"textSecondary":4287634968,"invertedBackground":4287634968,"overlayBackground":3426486020},"darkThemeColorPalette":{"baseBackground":4280156673,"raisedBackground":4282124036,"additiveBackground":735526711,"textPrimary":4294827997,"textSecondary":4294024344,"invertedBackground":4293426808,"overlayBackground":3426486020},"position":"FACTOID_POSITION_LAST","enableColorSampledText":true}}],"channelNavigationEndpoint":{"clickTrackingParams":"CBQQ040EGAciEwjVsa7rlLySAxXsCmgIHakfMoPKAQQe7bH9","commandMetadata":{"webCommandMetadata":{"url":"/@KinoCheck.com","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCLRlryMfL8ffxzrtqv0_k_w","canonicalBaseUrl":"/@KinoCheck.com"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/7YMfg30cMm6ogeHRBCF-kN3qEyY0Bg9ARei8ZfJrgnX7jv5Qlt2wFHpnntfPYk1fwnSi3GUw9g=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Show more"}},"simpleText":"...more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"This time in the #KinoCheckNews Highlander, Deadpool 4, Star Wars, Black Panther 3, \"How to Train Your Dragon 2\" etc.| App  https://KinoCheck.com/App | Best Movie News Show | All News https://KinoCheck.com/news\n\n00:00 First Images from the Highlander Reboot Starring Henry Cavill\nHenry Cavill has taken on the lead role in the reboot of the fantasy classic \"Highlander\". Now he's sharing the first images from the film with his fans.\nhttps://kinocheck.com/news/2s2qyk\n\n01:11 Rumor: Work on Deadpool 4 Has Begun!\nThe mercenary with the big mouth returns! After the huge success of \"Deadpool \u0026 Wolverine\", fans are eagerly awaiting a fourth film in the series  and now the time has come. As Puck magazine reports, Ryan Reynolds is indeed working hard on \"Deadpool 4\"!\nhttps://kinocheck.com/news/3obf4w\n\n02:03 New Trailers\n\n02:46 The Beekeeper 2: Release Date for the Jason Statham Sequel Announced\nThe Hollywood star returns in \"The Beekeeper 2\"! Following the success of the first film, the sequel to the action thriller is in the pipeline. Amazon MGM has now officially announced the release date. And with \"Shelter\", another Jason Statham action film is just around the corner\nhttps://kinocheck.com/news/xj3nbx\n\n03:38 New Update on Taika Waititi's Star Wars Movie\nThe as yet untitled film by \"Thor\" director Taika Waititi has not yet been affected by this. Kathleen Kennedy recently spoke briefly about the current status of the project in her \"exit interview\" with industry magazine Deadline. Taika Waititi himself has also revealed a few details about his film!\nhttps://kinocheck.com/news/3km831\n\n04:33 New Star Trek Movie: Chris Pine Gives Kirk Fans Little Hope\nChris Pine commented on a possible return as Enterprise captain James T. Kirk. However, his words give fans little reason for hope.\nhttps://kinocheck.com/news/nlz06j\n\n05:19 Aaron Pierre in Talks to Become the New Black Panther\nHot rumors about the casting of the new Black Panther! After \"F1\" star Damson Idris has already been linked to the role several times, another actor is now throwing his hat into the ring. As insider Daniel Richtman revealed, \"Rebel Ridge\" star Aaron Pierre is now also in talks with Marvel.\nhttps://kinocheck.com/news/uf69m9\n\n06:13 No Theatrical Release! The Gundam Film Starring Sydney Sweeney Will Be Released on Netflix\nAccording to Deadline, the \"Gundam\" live-action feature adaptation starring Sydney Sweeney won't be released in movie theaters. Instead, it will go straight to Netflix. That's not to say a theatrical release is completely off the table. After all, the streaming service has occasionally released movies in theaters for a limited time in the past. However, this has not been officially confirmed yet  so we'll just have to wait and see.\nhttps://kinocheck.com/news/sitpju/\n\n07:05 How to Train Your Dragon 2: Start of Filming and Casting Update for the Live-Action Adaptation\nFilming of the second live-action adaptation has now officially begun! This was announced by director Dean DeBlois and Universal Pictures via social media. But that's not all: there is also news regarding the cast!\nhttps://kinocheck.com/news/1x5qfb\n\n08:07 Tobey Maguire in Avengers Doomsday: Alleged Leak of the Opening Scene!\nSeveral well-known insiders have reported on the alleged opening scene, which is said to eclipse everything that superhero movies have ever shown at the beginning. Beware: There is a risk of spoilers if there is any truth to the rumors!\nhttps://kinocheck.com/news/euh4r7\n\n09:16 Dwayne Johnson to Return as the Scorpion King for The Mummy 4\nAccording to well-known insider Daniel Richtman, Universal Pictures is planning to bring Johnson back as the Scorpion King for \"The Mummy 4\". The character was introduced in 2001's \"The Mummy Returns\" and served as the central antagonist.\nhttps://kinocheck.com/news/0s660r\n\n10:34 The Brave and the Bold: Screenwriter Hired for New DCU Batman Film\nFinally, some progress on the new DCU Batman! With \"The Brave and the Bold\", we are getting a second Dark Knight alongside Robert Pattinson  and now it looks like we know who's writing the story.\nhttps://kinocheck.com/news/7dp1hp\n\n11:28 Game of Thrones Sequel Series \u0026 Possible Feature Film About Aegon's Conquest!\nNew projects from Westeros are already being worked on behind the scenes. These include a sequel series and a possible feature film about \"Aegon's Conquest\".\nhttps://kinocheck.com/news/m1tkry\n\n13:11 Here are the 2026 Oscar Nominations!\nThe 98th Academy Awards ceremony will take place on March 15, 2026. As usual, the most important film event of the year will honor the outstanding actors, directors, screenwriters and co. for their achievements. The big surprise i gth":237,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4388,"length":33,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4421,"length":2,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4423,"length":5,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4428,"length":310,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4738,"length":33,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4771,"length":79,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4850,"length":10,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"},{"startIndex":4860,"length":1,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}],"backgroundColorStyle":"BACKGROUND_COLOR_STYLE_COLOR_SAMPLED","lightThemeColorPalette":{"baseBackground":4294963440,"raisedBackground":4294963440,"additiveBackground":567754551,"textPrimary":4282124036,"textSecondary":4287634968,"invertedBackground":4287634968,"overlayBackground":3426486020},"darkThemeColorPalette":{"baseBackground":4280156673,"raisedBackground":4282124036,"additiveBackground":735526711,"textPrimary":4294827997,"textSecondary":4294024344,"invertedBackground":4293426808,"overlayBackground":3426486020},"colorSampledDescriptionBodyText":{"content":"This time in the #KinoCheckNews Highlander, Deadpool 4, Star Wars, Black Panther 3, \"How to Train Your Dragon 2\" etc.| App  https://KinoCheck.com/App | Best Movie News Show | All News https://KinoCheck.com/news\n\n00:00 First Images from the Highlander Reboot Starring Henry Cavill\nHenry Cavill has taken on the lead role in the reboot of the fantasy classic \"Highlander\". Now he's sharing the first images from the film with his fans.\nhttps://kinocheck.com/news/2s2qyk\n\n01:11 Rumor: Work on Deadpool 4 Has Begun!\nThe mercenary with the big mouth returns! After the huge success of \"Deadpool \u0026 Wolverine\", fans are eagerly awaiting a fourth film in the series  and now the time has come. As Puck magazine reports, Ryan Reynolds is indeed working hard on \"Deadpool 4\"!\nhttps://kinocheck.com/news/3obf4w\n\n02:03 New Trailers\n\n02:46 The Beekeeper 2: Release Date for the Jason Statham Sequel Announced\nThe Hollywood star returns in \"The Beekeeper 2\"! Following the success of the first film, the sequel to the action thriller is in the pipeline. Amazon MGM has now officially announced the release date. And with \"Shelter\", another Jason Statham action film is just around the corner\nhttps://kinocheck.com/news/xj3nbx\n\n03:38 New Update on Taika Waititi's Star Wars Movie\nThe as yet untitled film by \"Thor\" director Taika Waititi has not yet been affected by this. Kathleen Kennedy recently spoke briefly about the current status of the project in her \"exit interview\" with industry magazine Deadline. Taika Waititi himself has also revealed a few details about his film!\nhttps://kinocheck.com/news/3km831\n\n04:33 New Star Trek Movie: Chris Pine Gives Kirk Fans Little Hope\nChris Pine commented on a possible return as Enterprise captain James T. Kirk. However, his words give fans little reason for hope.\nhttps://kinocheck.com/news/nlz06j\n\n05:19 Aaron Pierre in Talks to Become the New Black Panther\nHot rumors about the casting of the new Black Panther! After \"F1\" star Damson Idris has already been linked to the role several times, another actor is now throwing his hat into the ring. As insider Daniel Richtman revealed, \"Rebel Ridge\" star Aaron Pierre is now also in talks with Marvel.\nhttps://kinocheck.com/news/uf69m9\n\n06:13 No Theatrical Release! The Gundam Film Starring Sydney Sweeney Will Be Released on Netflix\nAccording to Deadline, the \"Gundam\" live-action feature adaptation starring Sydney Sweeney won't be released in movie theaters. Instead, it will go straight to Netflix. That's not to say a theatrical release is completely off the table. After all, the streaming service has occasionally released movies in theaters for a limited time in the past. However, this has not been officially confirmed yet  so we'll just have to wait and see.\nhttps://kinocheck.com/news/sitpju/\n\n07:05 How to Train Your Dragon 2: Start of Filming and Casting Update for the Live-Action Adaptation\nFilming of the second live-action adaptation has now officially begun! This was announced by director Dean DeBlois and Universal Pictures via social media. But that's not all: there is also news regarding the cast!\nhttps://kinocheck.com/news/1x5qfb\n\n08:07 Tobey Maguire in Avengers Doomsday: Alleged Leak of the Opening Scene!\nSeveral well-known insiders have reported on the alleged opening scene, which is said to eclipse everything that superhero movies have ever shown at the beginning. Beware: There is a risk of spoilers if there is any truth to the rumors!\nhttps://kinocheck.com/news/euh4r7\n\n09:16 Dwayne Johnson to Return as the Scorpion King for The Mummy 4\nAccording to well-known insider Daniel Richtman, Universal Pictures is planning to bring Johnson back as the Scorpion King for \"The Mummy 4\". The character was introduced in 2001's \"The Mummy Returns\" and served as the central antagonist.\nhttps://kinocheck.com/news/0s660r\n\n10:34 The Brave and the Bold: Screenwriter Hired for New DCU Batman Film\nFinally, some progress on the new DCU Batman! With \"The Brave and the Bold\", we are getting a second Dark Knight alongside Robert Pattinson  and now it looks like we know who's writing the story.\nhttps://kinocheck.com/news/7dp1hp\n\n11:28 Game of Thrones Sequel Series \u0026 Possible Feature Film About Aegon's Conquest!\nNew projects from Westeros are already being worked on behind the scenes. These include a sequel series and a possible feature film about \"Aegon's Conquest\".\nhttps://kinocheck.com/news/m1tkry\n\n13:11 Here are the 2026 Oscar Nominations!\nThe 98th Academy Awards ceremony will take place on March 15, 2026. As usual, the most important film event of the year will honor the outstanding actors, directors, screenwriters and co. for their achievements. The big surprise in the run-up: a new Oscar record was set!\nhttps://kinocheck.com/news/8vmz4k\n\nNote | News with courtesy of all involved publishers. | All Rights Reserved. #KinoCheck","commandRuns":[{"startIndex":17,"length":14,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCwQ3NcEGEQiEwjVsa7rlLySAxXsCmgIHakfMoPKAQQe7bH9","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/kinochecknews","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gURCg1raW5vY2hlY2tuZXdzGAE%3D"}}},"loggingDirectives":{"trackingParams":"CCwQ3NcEGEQiEwjVsa7rlLySAxXsCmgIHakfMoM="}},{"startIndex":133,"length":25,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBQQ040EGAciEwjVsa7rlLySAxXsCmgIHakfMoNI95vbsM-CjO5PygEEHu2x_Q==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa2lFWGVkdUFNWVpPYlhhNzhIZ0haQ3VMSUdWd3xBQ3Jtc0tuUGU4ZGJSSTBXRFphUFlfY0NmY2JMT0MzZThGTFNtcG9SbnVTQnc5b0F3WFV0QXhMenNEeGlKNHFZOTNSd3g0d3ZIc2ZiS3A4ZlBfbHBFSnBxVkZXbFM0Qm1zUVZaSGt5ME1ZNUttNExKTkMxZU9RUQ\u0026q=https%3A%2F%2FKinoCheck.com%2FApp\u0026v=T9wwFPYWzfc","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa2lFWGVkdUFNWVpPYlhhNzhIZ0haQ3VMSUdWd3xBQ3Jtc0tuUGU4ZGJSSTBXRFphUFlfY0NmY2JMT0MzZThGTFNtcG9SbnVTQnc5b0F3WFV0QXhMenNEeGlKNHFZOTNSd3g0d3ZIc2ZiS3A4ZlBfbHBFSnBxVkZXbFM0Qm1zUVZaSGt5ME1ZNUttNExKTkMxZU9RUQ\u0026q=https%3A%2F%2FKinoCheck.com%2FApp\u0026v=T9wwFPYWzfc","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":193,"length":26,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBQQ040EGAciEwjVsa7rlLySAxXsCmgIHakfMoNI95vbsM-CjO5PygEEHu2x_Q==","commandMetadata":{"webComma
